import React from 'react';
import data from './a.json';
import {Route,Switch,Link}  from 'react-router-dom';
import B from './b'
var element=data;
class All extends React.Component{
    constructor(){
        super()
        this.state={
            arr:[]
        }
    }
    componentDidMount()
    {
        element.map((e)=>
            (
                this.setState({arr:e})

        ))


    }

    render()
    {
        return(

           element.map((e,i)=>
            (

                    <Switch>
                        <Route  exact path='/' >
                    <li><Link to={'/b/'+e.id} >{e.title}</Link></li></Route>
                    <Route  exact path='/b/:id' component={B}></Route>
                    </Switch>

            )
            )
            )

    }
}
export default All;
